import React, { Component } from 'react';
import './Char.css';


const Char = props =>  {

    if (props.string) {
        stringList = (props.string.split("").map(c => <li>c</li>))
    }     

    return (
      <div >
         <ol>
            {stringList}
         </ol>
      </div>
    );

}

export default Char;
